import React, {useState, FC} from 'react'
import { useAppSelector } from '../app/hooks';
import { store } from '../app/store';
import { ReactHooksVpcNameForm } from '../features/vpc/ReactHooksVpcName';

  
interface tf {
  keyName:string
}


export const MakeTerraformFile: FC<tf> = (props) => {

  console.log(props.keyName)
  const setVpcName = localStorage.getItem(props.keyName)
  return (
    <>
      <p>{ setVpcName }</p>
      <div>
        {ReactHooksVpcNameForm}
      </div>
      <a href="/">戻る</a>
    </>
  );
  }
